function downImg(index, end){
  const item = imgList[index]
  if(item && index < end){
    let a = document.createElement('a');
    a.style.display = 'none'
  
    a.href = item.img
    a.download= item.cover
  
    document.body.appendChild(a)
    a.click()
    document.body.removeChild(a);

    console.log(`-------${index} done-${end - 500}--${end}------`)

    setTimeout(() => {
      downImg(index + 1, end)
    }, 1000)
  }else{
    console.log(`============ end ${end}============`)
  }
}
